sys_variable_value.value:
(function execute(inputs, outputs) {
  var xmlDoc = new XMLDocument2();
  xmlDoc.setNamespaceAware(true);
  xmlDoc.parseXML(inputs.response_body);
  var temp = gs.xmlToJSON(xmlDoc.getDocumentElement());
  if (inputs.status == 200) {
    outputs.status = "Success";
    var contents = temp.CreateTargetGroupResponse.CreateTargetGroupResult.TargetGroups.member;
      outputs.target_group_arn = contents.TargetGroupArn ;
      outputs.health_checked_enabled = contents.HealthCheckEnabled ;
      outputs.health_check_timeout_seconds = contents.HealthCheckTimeoutSeconds ;
      outputs.health_check_interval_seconds = contents.HealthCheckIntervalSeconds ;
  } else {
    outputs.status = "Error";
    outputs.error_message = temp.ErrorResponse.Error.Message;
  }
})(inputs, outputs);

